<p>'We’re having a baby! We are so happy to share our beautiful news with everyone,' she captioned the post. </p>

<p>'We're having a baby!' Married At First Sight's Tracey Jewel (left) announces that she's pregnant with her boyfriend Nate's (right) child</p>

<p>'I have always believed in second chances and my second baby I’ve been waiting so long for,' she added. </p>

<p>'My daughter Grace is going to be an amazing big sister and I’m so so grateful to be experiencing pregnancy + motherhood again with my love Nate x.' </p>

<p>She also posted a picture of her ultrasounds and a baby onesie that read: 'Coming soon.' </p>

